import Header from '../../components/Header';
import Footer from '../../components/Footer';

const Produtos = () => {
  return (
    <div className='container-fluid'>
      <Header />
      <div className='row'>
        <div className='col-3'></div>
        <div className='col-9'></div>
      </div>
      <Footer />
    </div>
  );
};

export default Produtos;
